import zadanie_5_1 as cimport reprecedence = {'*': 1, '/': 1, '+': 0, '-': 0}out = []stack = []i = 0def check_precedence(stack, ope):    return precedence[ope] <= precedence[stack[len(stack) - 1]]s = "25 - 2 / 4 * 2 + 3 + 3 * 8 / 2"#s = "3 - 2 * 2 + 3"s = s.split()print(s)# The Shunting Yard Algorithmfor x in s:    flag = re.match('[0-9]', x)    if flag:        out.append(int(x))    else:        while stack and check_precedence(stack, x):            out.append(stack[len(stack) - 1])            stack.pop()        stack.append(x)stack.reverse()for x in stack:    out.append(x)numb = ''numb1 = ''numb2 = ''i = 0while len(out) != 1:    print(out)    i = 0    for x in out:        if str(type(x)) != '<class \'int\'>' and str(type(x)) != '<class \'float\'>':            if x == '+':                numb = numb1 + numb2            elif x == '-':                numb = numb1 - numb2            elif x == '*':                numb = numb1 * numb2            elif x == '/':                numb = numb1 / numb2            else:                print("Error! Unrecognized operator")            out.pop(i)            out.pop(i - 1)            out.pop(i - 2)            out.insert(i - 2, numb)            break        else:            numb1 = numb2            numb2 = x        i = i + 1print(out)